    x7 += einsum(t2, (0, 1, 2, 3), (0, 1, 3, 2))
    x8 = np.zeros((nocc, nocc, nvir, nvir), dtype=np.float64)
    x8 += einsum(t2, (0, 1, 2, 3), (0, 1, 2, 3))
    x8 += einsum(t2, (0, 1, 2, 3), (0, 1, 3, 2)) * -1.0
    x9 = np.zeros((nocc, nocc), dtype=np.float64)
